import React, { useState }  from "react";
import  './index.css';



function App(){

   const [list,upList] = useState();
   const [showlist,upshowList] = useState();

    function Show(e){
           upList(e.target.value)
    }
    function show(){
           upshowList(list);
    }




    return(
        <div className="main">
        <div className="centre-div">
            <br/> <br />
            <div className="heading">
                <h1>Todo's List</h1>
            </div>
            <br />
            <div className="input-text">
                <input type="text" placeholder="Enter an item" onChange={Show} />
                <button onClick={show}>+</button>
            </div>
            <br />
            <div className="list-items">
                <ol>
                    {showlist}
                </ol>
            </div>
            <br />
        </div>
        </div>
    )
}
 export default App;
